import { hotels } from "./data";
import Afficher from "./Afficher";
export default function Q4(){
    return(
        hotels.filter(function(hotel){
        
            hotel.ville==="laayoune"
        }).map(function(hot,i){
            return(
                <Afficher hotel={hot} key={i} />
            )
        })
    )
}
